import { CoreService } from './services/CoreService.js';
import { EventHandlingModule } from './modules/EventHandlingModule.js';
import React from 'react';
import './index.css';
import ReactDOM from 'react-dom/client';
import App from './App';
import { PublicClientApplication } from '@azure/msal-browser';
import { MsalProvider } from '@azure/msal-react';
import { msalConfig } from './Auth/authConfig';

(async () => {
    try {
        // Use centralized initialization
        await CoreService.initialize();
        
        // Set up event listeners after page loads
        window.addEventListener('DOMContentLoaded', () => {
            EventHandlingModule.setupEventListeners();
        });
    } catch (error) {
        console.error('Application initialization failed:', error);
    }
})();

const msalInstance = new PublicClientApplication(msalConfig);

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <MsalProvider instance={msalInstance}>
      <App />
    </MsalProvider>
  </React.StrictMode>
);
